import Cabecalho from '../../utils/cabecalho';
import Menu from '../../utils/menu';
import { 
    Container,
    Row,
    Col,
} from 'react-bootstrap';

function Home() {
    return ( 
        <div>
            <Cabecalho />
            <Container fluid>
                <Row>
                    <Col md={3}>
                    </Col>
                    <Col md={9}>
                    </Col>
                </Row>
            </Container>
        </div> 
    );
}

export default Home;
